import React from 'react'
import {  useParams } from "react-router-dom";
import CallIcon from "../assets/phone-call.png"

const ConControls = () => {
    // Getting username from URL
    let { username } = useParams();

    function init_call()
    {
        console.log("calling");
    }


    return (
        <div className='ConControls'>
            <div id='ConControls-friendname'>{username}</div>
            <div id='ConControls-Call-icon'><img src={CallIcon} alt="call" onClick={init_call()}/></div>
        </div>
    )
}

export default ConControls
